Throttle body was well overdue for a cleaning, so I took care of that and got the new k&n cold air intake installed. @line_em_up_performance I definitely notice less drag when driving, better acceleration and throttle response. Idled around 900 rpms on the first crank. I'm feeling the performance but it doesn't sound like I expected. Maybe I just need to get used to it and/or break it in.
