Replaced the rear stock speakers with a pair of kicker 10x4 ksc4100's. Was going to go with 6x9's but decided to go with the factory size so I wouldn't have to cut the speaker brackets. Trying to keep it as original as possible. Getting the interior right before I add the bang. Just gotta wire this amp and the insides will be done. It's a process but it'll be worth it.
